import React from "react";
import Navprofile from "./Components/navprofile/Navprofile";
import { Box } from "@mui/system";
import { Grid } from "@mui/material";
import Navbarprofile from "./Components/Navbarprofile/Navbarprofile";
const Test = () => {
  return (
    <div
      style={{
        backgroundColor: "red",
        display: "flex",
        justifyItems: "column",
        width: "200vh",
      }}
    >
      <div
        style={{
          backgroundColor: "yellow",
          display: "inline-block",
          //position: "fixed",
        }}
      >
        <Navprofile />
      </div>

      <div
        style={{
          backgroundColor: "green",
          width: "185vh",
          display: "flex",
          height: "500px",
          //justifyContent: "column",
        }}
      >
        <div
          style={{
            backgroundColor: "red",
            display: "inline-block",
            height: "65px",
            // width: "1600px",
            //position: "fixed",
          }}
        >
          <Navbarprofile />
        </div>
        <div
          style={{
            backgroundColor: "orange",
            display: "inline-block",
            height: "65px",
            // width: "1600px",
            //position: "fixed",
          }}
        >
          hhcgcjh
        </div>
      </div>
    </div>
  );
};

export default Test;
